import React from "react";

 const headerStyle = {
    fontStyle: "normal",
    fontWeight: "500",
    fontSize: "24px",
    lineHeight: "120%",
    letterSpacing: "0.0022em",
    color: "rgb(0, 0, 0, 0.87)",
    margin: "24px 0px"
  }

const FooterSubscribe = () => {
  return (
    <div>
      <h1 style={headerStyle}>Thank you for sending your email!, I will message you soon.</h1>
    </div>
  );
};

export default FooterSubscribe;
